import React from 'react';
import styled from 'styled-components';

const UserImage = styled.img`
height:60px;
margin-left:2rem;
border-radius:50%;
`

const User = (props) => {
    return (
        <div>
            <h1>Welcome, {props.user.username} <UserImage src={props.user.avatar_url} alt={props.user.username} /></h1>
        </div>
    );
};

export default User;
